import React from 'react';
import './Part.css';

function Part({ value, setPlayed }) {
  console.log(value);
  return (
    <div
      onClick={(e) => console.log(e.target)}
      className={value ? `play${value}` : 'notPlayed'}
    ></div>
  );
}

export default Part;
